    notes:
      '* <i>Bloodlust</i> can still be activated even if <b>Tryndamere</b> does not have any <b>Fury</b>.\n<ul><li><i>Bloodlust</i> can be activated at any point of <b>Tryndamere\'s</b> <a href="/wiki/Basic_attack" title="Basic attack">basic attack</a>.\n<ul><li>Note that if an <a href="/wiki/Basic_attack" title="Basic attack">basic attack</a> will <span style="white-space:pre; position:relative;" class="glossary" data-tip="Critically strike" data-game="lol"><a href="/wiki/Critical_strike" title="Critical strike"><img data-relevant="1" data-image-key="Critical_strike_icon.png" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/4/41/Critical_strike_icon.png/revision/latest/scale-to-width-down/20?cb=20191126102550" class="lazyload" width="20" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" loading="lazy" data-image-name="Critical strike icon.png" height="20" alt="Critical strike icon" decoding="async"></a> <a href="/wiki/Critical_strike" title="Critical strike">critically strike</a></span> is determined when the <a title="Basic attack" href="/wiki/Basic_attack">basic attack</a> starts.\n<ul><li>This means that if <span class="inline-image label-after ability-icon" data-param="" style="display:inline;white-space:pre;" data-champion="Tryndamere" data-game="lol" data-ability="Bloodlust"><span data-width="20" class="border" style="display:inline-block;position:relative;"><a href="/wiki/Tryndamere/LoL#Bloodlust" title="Bloodlust"><img data-image-name="Tryndamere Bloodlust.png" alt="Bloodlust" data-relevant="0" class="thumbborder lazyload" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/f/f2/Tryndamere_Bloodlust.png/revision/latest/scale-to-width-down/20?cb=20140618163648" height="20" loading="lazy" width="20" data-image-key="Tryndamere_Bloodlust.png" decoding="async" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D"></a></span> <span style="white-space:normal;"><a href="/wiki/Tryndamere/LoL#Bloodlust" title="Tryndamere/LoL">Bloodlust</a></span></span> is cast during Tryndamere\'s <a href="/wiki/Basic_attack" title="Basic attack">basic attack</a> windup, the attack will use the <span data-game="lol" style="white-space:pre; position:relative;" class="glossary" data-tip="Critical strike"><a title="Critical strike" href="/wiki/Critical_strike"><img src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" alt="Critical strike icon" data-src="https://static.wikia.nocookie.net/leagueoflegends/images/4/41/Critical_strike_icon.png/revision/latest/scale-to-width-down/20?cb=20191126102550" width="20" class="lazyload" data-image-key="Critical_strike_icon.png" data-image-name="Critical strike icon.png" height="20" decoding="async" loading="lazy" data-relevant="1"></a> <a href="/wiki/Critical_strike" title="Critical strike">critical strike</a></span> chance given by the <span style="color: #FA6533; white-space:normal">Fury</span> <b>before</b> the <span style="display:inline;white-space:pre;" class="inline-image label-after ability-icon" data-param="" data-ability="Bloodlust" data-champion="Tryndamere" data-game="lol"><span class="border" style="display:inline-block;position:relative;" data-width="20"><a href="/wiki/Tryndamere/LoL#Bloodlust" title="Bloodlust"><img data-src="https://static.wikia.nocookie.net/leagueoflegends/images/f/f2/Tryndamere_Bloodlust.png/revision/latest/scale-to-width-down/20?cb=20140618163648" width="20" decoding="async" data-relevant="0" loading="lazy" data-image-name="Tryndamere Bloodlust.png" data-image-key="Tryndamere_Bloodlust.png" src="data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D" alt="Bloodlust" class="thumbborder lazyload" height="20"></a></span> <span style="white-space:normal;"><a title="Tryndamere/LoL" href="/wiki/Tryndamere/LoL#Bloodlust">Bloodlust</a></span></span> cast.</li>\n<li>Furthermore, the <span style="color: #FA6533; white-space:normal">Fury</span> for that <a href="/wiki/Basic_attack" title="Basic attack">basic attack</a> will be given once the windup completes. This lets <b>Tryndamere</b> start building <span style="color: #FA6533; white-space:normal">Fury</span> immediately.</li></ul></li></ul></li></ul>',
